// Import React
import React from "react";

// Import UI components from reactstrap framework
import { Card, CardHeader } from 'reactstrap';

// Saved articles component.
const SavedArticles = props => (
      <Container>
     <Card className="saved-articles main-content-section" id="articles">
        <CardHeader>
            <h2 class="card-header">Saved Articles:</h2>

        </CardHeader>
    </Card>
        <Row>
          <Col size="md-12">
            <Panel title="Saved Articles" icon="download">
              {this.state.articles.length ? (
                <List>
                  {this.state.articles.map(article => (
                    <Article
                      key={article._id}
                      _id={article._id}
                      title={article.title}
                      url={article.url}
                      date={article.date}
                      handleClick={this.handleArticleDelete}
                      buttonText="Delete Article"
                      saved
                    />
                  ))}
                </List>
              ) : (
                <h2 className="text-center">No Saved Articles</h2>
              )}
            </Panel>
          </Col>
        </Row>
        <Footer />
      </Container>
)
// Export saved articles component
export default SavedArticles;
